import React, { useState } from "react";
import "./StockScanner.css";

const StockScanner = ({ onTickersChange }) => {
  const [minPrice, setMinPrice] = useState("");
  const [maxPrice, setMaxPrice] = useState("");
  const [minRSI, setMinRSI] = useState(30);
  const [maxRSI, setMaxRSI] = useState(70);
  const [volumeSurge, setVolumeSurge] = useState(1.2);

  const fetchStocks = () => {
    // Mocking an API call
    const mockTickers = ["AAPL", "MSFT", "TSLA", "GOOGL"];
    onTickersChange(mockTickers);
  };

  return (
    <div className="search-form">
      <label>
        Min Price:
        <input
          type="number"
          value={minPrice}
          onChange={(e) => setMinPrice(e.target.value)}
          placeholder="Min Price"
        />
      </label>
      <label>
        Max Price:
        <input
          type="number"
          value={maxPrice}
          onChange={(e) => setMaxPrice(e.target.value)}
          placeholder="Max Price"
        />
      </label>
      <label>
        Min RSI:
        <input
          type="number"
          value={minRSI}
          onChange={(e) => setMinRSI(e.target.value)}
          placeholder="Min RSI"
        />
      </label>
      <label>
        Max RSI:
        <input
          type="number"
          value={maxRSI}
          onChange={(e) => setMaxRSI(e.target.value)}
          placeholder="Max RSI"
        />
      </label>
      <label>
        Volume Surge:
        <input
          type="number"
          step="0.1"
          value={volumeSurge}
          onChange={(e) => setVolumeSurge(e.target.value)}
          placeholder="Volume Surge"
        />
      </label>
      <button onClick={fetchStocks}>Search Stocks</button>
    </div>
  );
};

export default StockScanner;
